import {
  Card,
  CardActions,
  CardContent,
  CardMedia,
  Button,
  Typography,
  Avatar,
} from "@mui/material";
import { Box } from "@mui/system";

import React from "react";

const ReactionChannels = () => {
  return (
    <div className="container">
      <Card sx={{ maxWidth: 345 }}>
        <Typography gutterBottom variant="h5" component="div">
          Lizard
        </Typography>
        <CardMedia
          component="img"
          height="140"
          image="/static/images/cards/contemplative-reptile.jpg"
          alt="green iguana"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="div">
            Lizard
          </Typography>
          <Typography variant="body2" color="text.secondary">
            Lizards are a widespread group of squamate reptiles, with over 6,000
            species, ranging across all continents except Antarctica
          </Typography>
        </CardContent>
        <CardActions>
          <Box
            sx={{
              display: "flex",
              justifyContent: "space-evenly",
              alignContent: "space-evenly",
            }}
          >
            <Box sx={{ mr: 2 }}>
              <Avatar
                className="ripple"
                alt="Remy Sharp"
                // src={newsLogo}
                // onClick={() => setTimeout(() => navigate("newschannels"), 1000)}
              />
            </Box>

            <Box>
              <Avatar
                className="ripple"
                alt="Remy Sharp"
                // src={newsLogo}
                // onClick={() => setTimeout(() => navigate("newschannels"), 1000)}
              />
            </Box>

            <Box>
              <Avatar
                className="ripple"
                alt="Remy Sharp"
                // src={newsLogo}
                // onClick={() => setTimeout(() => navigate("newschannels"), 1000)}
              />
            </Box>

            <Box>
              <Avatar
                className="ripple"
                alt="Remy Sharp"
                // src={newsLogo}
                // onClick={() => setTimeout(() => navigate("newschannels"), 1000)}
              />
            </Box>
          </Box>
        </CardActions>
      </Card>
    </div>
  );
};

export default ReactionChannels;
